class MapContainer extends Component {


 render() {
   return (
        <Map id = "map" google={this.props.google} zoom={3}>


        </Map>
   );
 }
}


export default GoogleApiWrapper({
    apiKey: "AIzaSyBHLett8djBo62dDXj0EjCimF8Rd6E8cxg"
  })(MapContainer)
